import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'; // Optional: Import global CSS styles
import App from './App';
import * as serviceWorkerRegistration from './serviceWorkerRegistration'; // Optional: Service worker for PWA

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

// Optional: Uncomment this line to enable service worker
